.wrappercontainer {
  max-width: 1510px;
  height: 500px;
  margin: 0 auto;
  position: relative;
}

.wrapper {
  height: auto;
  margin: 0 auto;
  width: 100%;
  padding: 0;
  position: absolute;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  -o-box-sizing: border-box;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  align-items: center;
}

.slider {
  height: 500px;
  width: 100%;
  overflow: hidden;
  position: relative;
}

.slides {
  width: 100%;
  height: inherit;
  overflow: hidden;
  opacity: 0;
  position: absolute;
  z-index: 0;
  -webkit-transform: scale(1.5);
  -moz-transform: scale(1.5);
  -o-transform: scale(1.5);
  transform: scale(1.5);
  -webkit-transition: transform ease-in-out 0.5s, opacity ease-in-out 0.5s;
  -moz-transition: transform ease-in-out 0.5s, opacity ease-in-out 0.5s;
  -o-transition: transform ease-in-out 0.5s, opacity ease-in-out 0.5s;
  transition: transform ease-in-out 0.5s, opacity ease-in-out 0.5s;
}
@media screen and (min-width: 768px) and (max-width: 1024px) {
  .slides {
    display: flex;
    flex-direction: column;
  }
}
@media screen and (min-width: 480px) and (max-width: 767px) {
  .slides {
    display: flex;
    flex-direction: column;
  }
}
@media screen and (min-width: 320px) and (max-width: 479px) {
  .slides {
    display: flex;
    flex-direction: column;
  }
}

.pic1 {
  width: 50%;
  height: 100%;
  position: absolute;
  overflow: hidden;
  box-sizing: border-box;
}
@media screen and (min-width: 768px) and (max-width: 1024px) {
  .pic1 {
    width: 100%;
    height: 50%;
    object-fit: cover;
  }
}
@media screen and (min-width: 1024px) and (max-width: 1520px) {
  .pic1 {
    object-fit: cover;
  }
}
@media screen and (min-width: 480px) and (max-width: 767px) {
  .pic1 {
    width: 100%;
    height: 50%;
    object-fit: cover;
  }
}
@media screen and (min-width: 320px) and (max-width: 479px) {
  .pic1 {
    width: 100%;
    height: 50%;
    object-fit: cover;
  }
}

.slidetext {
  width: 50%;
  height: 500px;
  float: right;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
@media screen and (min-width: 768px) and (max-width: 1024px) {
  .slidetext {
    width: 100%;
    height: 100%;
    align-items: center;
    justify-content: flex-end;
  }
}
@media screen and (min-width: 480px) and (max-width: 767px) {
  .slidetext {
    width: 100%;
    height: 100%;
    align-items: center;
    justify-content: flex-end;
  }
}
@media screen and (min-width: 320px) and (max-width: 479px) {
  .slidetext {
    width: 100%;
    height: 100%;
    align-items: center;
    justify-content: flex-end;
  }
}

.slide1 {
  background-color: #5C3249;
}

.slide2 {
  background-color: #5C3249;
  position: absolute;
}

.slide3 {
  background-color: #5C3249;
  position: absolute;
}

.slide4 {
  background-color: #5C3249;
  position: absolute;
}

.slide5 {
  background-color: #5C3249;
  position: absolute;
}

#slide1:checked ~ .slider > .slide1,
#slide2:checked ~ .slider > .slide2,
#slide3:checked ~ .slider > .slide3,
#slide4:checked ~ .slider > .slide4,
#slide5:checked ~ .slider > .slide5 {
  opacity: 1;
  z-index: 1;
  -webkit-transform: scale(1);
  -moz-transform: scale(1);
  -o-transform: scale(1);
  transform: scale(1);
}

.wrapper > input {
  display: none;
}

.wrapper label {
  cursor: pointer;
  display: inline-block;
  height: 14px;
  margin: 25px 12px 0 16px;
  position: relative;
  width: 14px;
  -webkit-border-radius: 50%;
  -moz-border-radius: 50%;
  -o-border-radius: 50%;
  border-radius: 50%;
  -webkit-transition: background ease-in-out 0.5s;
  -moz-transition: background ease-in-out 0.5s;
  -o-transition: background ease-in-out 0.5s;
  transition: background ease-in-out 0.5s;
}

.wrapper label:hover,
#slide1:checked ~ .controls label:nth-of-type(1),
#slide2:checked ~ .controls label:nth-of-type(2),
#slide3:checked ~ .controls label:nth-of-type(3),
#slide4:checked ~ .controls label:nth-of-type(4),
#slide5:checked ~ .controls label:nth-of-type(5) {
  background-color: #7E5D6F;
}

.wrapper label:after {
  border: 1px solid #7E5D6F;
  content: " ";
  display: block;
  height: 12px;
  left: 0;
  position: absolute;
  top: 0;
  width: 12px;
  -webkit-border-radius: 50%;
  -moz-border-radius: 50%;
  -o-border-radius: 50%;
  border-radius: 50%;
}
